const AddCart = (props) => {
    return (
    <div id="cart">
      <table id='tbl'>
        {props.cart.map((item,i)=>{
            return (
            <tr>
              <td>{item.name}</td>
              <td>{item.price}</td>
              <td><div className="btnDiv"><button>-</button><input className='num' type='number' value={item.quantity}/><button>+</button></div></td>
              <td></td>
              <td><button id='btnDel'>X</button></td>
            </tr>
            )
        })}
        </table>
    </div>
  )
}
export default AddCart
